con:config.script:
/*
 * This script set service provider and edr topup origin for edr data in edr_data table from reporting db.
 * Date: 2021-10-19 
 * Autor: Michael Gordon
*/

// read data
String sMediaType = context.expand( '${Data Source-getTopups-forEDR#media_type}' )

// set values in test-case properties.
if (sMediaType!=null && sMediaType.toString().length()==2){

	if (sMediaType.equalsIgnoreCase('40')){
		testRunner.testCase.setPropertyValue( "edr_SP", 'SP504' )
		testRunner.testCase.setPropertyValue( "edr_topup_orig", '40M1' )
	}
	if (sMediaType.equalsIgnoreCase('23')){
		testRunner.testCase.setPropertyValue( "edr_SP", 'SP902' )
		testRunner.testCase.setPropertyValue( "edr_topup_orig", '23M1' )
	}
	if (sMediaType.equalsIgnoreCase('25')){
		testRunner.testCase.setPropertyValue( "edr_SP", 'SP901' )
		testRunner.testCase.setPropertyValue( "edr_topup_orig", '25M1' )
	}
	if (sMediaType.equalsIgnoreCase('28')){
		testRunner.testCase.setPropertyValue( "edr_SP", 'SP901' )
		testRunner.testCase.setPropertyValue( "edr_topup_orig", '28M1' )
	}
	log.info('Test case properties are set')
}

/*
 * This script create data and pathes for camt054 file
 * Additional cut first sign from correlationID from ATM started with 23.
 * Date: 2021-05-23 
 * Autor: Michael Gordon
*/

// read pathes 
String sTargetDir = context.expand( '${#TestCase#targetDir}' ).replace('\\','/')

String sFileName = context.expand( '${#Project#Random8}' )+'_CAMT054_ReportDB.xml'
String sTargetPath=(sTargetDir +'/' + sFileName)
log.info('Target paht is: - '+sTargetPath)
// set path to property
testRunner.testCase.setPropertyValue( "localPath", sTargetPath )

// cut first signs from correlation id from ATM
String corID = context.expand( '${#TestCase#correlationID}' ).toString()
if (corID!=null && corID.length()>2 && corID.substring(0,2).equalsIgnoreCase("23")){
	testRunner.testCase.setPropertyValue( "correlationID", corID.substring(1))
	log.info('Cut correltion id: - '+corID)
}
